<script>
    const countries = {!! json_encode($countries) !!};

    Alpine.data('map', () => {
        return {
            current: '',
            codes: countries,
            showCountries() {
                const codes = Object.keys(Alpine.raw(this.codes));
                var interval = setInterval(() => {
                    if (!codes.length) {
                        clearInterval(interval);
                        this.showFlags();
                    }
                    code = codes.shift();
                    let country = document.getElementById( code.toUpperCase() );
                    country.style.fill = '#10275B';
                    country.style.stroke = '#ffffff';
                }, 150);

            },
            showFlags()
            {
                const codes = Object.keys(Alpine.raw(this.codes));
                var interval = setInterval(() => {
                    if (!codes.length) {
                        clearInterval(interval);
                    }
                    code = codes.shift();
                    let country = document.getElementById( 'flag-' + code.toUpperCase() );
                    country.style.visibility = 'visible';

                    if(code == 'at'){
                        this.current = 'at';
                    }

                }, 150);
            }
        }
    })
</script>
